const express = require("express");
const app = express();
const http = require("http");
const server = http.createServer(app);
var cors = require("cors");
const { Server } = require("socket.io");
const io = new Server(server, {
  cors: {
    origin: "*",
    methods: ["GET", "POST"],
    allowedHeaders: [],
    credentials: false,
  },
});
const image1=""

const image2=""
io.on("connection", (socket) => {
  console.log("a user connected");
  socket.on("disconnect", () => {
    console.log("user disconnected");
  });
  setTimeout(() => {
    const data = {
      id: (Math.random() * 100).toFixed(0),
      hu: `Datos aleatoreo ${(Math.random() * 100).toFixed(0)}`,
      data:(Math.random() * 100).toFixed(0) % 2 ==0 ? image1:image2
    };
    io.emit("image_message",  {image:{image:image1}});
    io.emit("status_message", { system_status: {system_status:"Datos"} });
    io.emit("hu_message", { hu: {hu:data.hu} });
  }, 1000);
  socket.on("chat message", (msg) => {
    console.log("message: " + msg);
  });
  socket.on("locations_set", (msg) => {
    console.log("message: " + msg);
  });
});

server.listen(3000, () => {
  console.log("listening on *:3000");
});
app.use(cors());
app.get("/", (req, res) => {
  res.send("<h1>Hello world</h1>");
});
